                <div className='left photo'/>
                    
                
                <div className='right text'>
                    <p><span className='textMeaning'>Lorem ipsum dolor sit amet consectetur adipisicing elit. Neque maxime a voluptates soluta consectetur similique necessitatibus corrupti in quam alias? Aut officiis odio qui impedit labore necessitatibus voluptates adipisci dolores!</span></p>
                </div> 
                </div>      
 
            </div>
        );
    }
}

export default Mainpage;
